sys_variable_value.value:
(function execute(inputs, outputs) {

// ... code ...

  var user = new GlideRecord('sys_user');

  user.get(inputs.userRec.sys_id);

  var pwd = inputs.newPass.toString();

  user.user_password.setDisplayValue(pwd);
  outputs.uid = user.update();

})(inputs, outputs);

